import React, { Component } from 'react';
import { StyleSheet, Text, View} from 'react-native';
import { TextInput, TouchableOpacity } from 'react-native-gesture-handler';



export default class App extends Component {
  render() {
    return (
      <View style={styles.container}>
        <View style={styles.welcomeContainer}>
          <Text style={styles.welcome}>Welcome to the Covid-See10 Challenge</Text>
          <TextInput editable style={styles.username} placeholder="Username"></TextInput>
          <TextInput editable style={styles.password} placeholder="Password" secureTextEntry={true}></TextInput>
        </View>
        <View style={styles.authButtons}>
          <TouchableOpacity style={styles.loginButton}>
            <Text style={styles.loginText}>Login</Text>
          </TouchableOpacity>
          <TouchableOpacity style={styles.signUpButton}>
            <Text style={styles.signUpText}>Sign-Up</Text>
          </TouchableOpacity>
        </View>
      </View>
    );
  }
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    alignItems: 'center',
  },
  welcomeContainer: {
    flex: 1,
    alignItems: 'center',
    justifyContent: "center",
    // backgroundColor: "blue",
    width: "100%",
    maxHeight: "45%"

  },
  authButtons: {
    flex: 1,
    flexDirection: "row",
    justifyContent: "space-evenly",
    width: "100%",
  },
  welcome: {
    fontSize: 25,
    textAlign: 'center',
  }, 
  username: {
    width: "70%",
    height: "9%",
    borderColor: "red",
    borderWidth: 1,
    textAlign: "center",
    marginBottom: "4%",
    marginTop: "10%"
  },
  password: {
    width: "70%",
    height: "14%",
    borderColor: "red",
    borderWidth: 1,
    textAlign: "center",
  },
  loginButton: {
    maxHeight: "15%",
    minWidth: "30%",
    borderColor: "red",
    borderWidth: 1,
    flex: 1,
    justifyContent: "center"
  },
  loginText: {
    textAlign: "center",
    fontSize: 20,
  },
  signUpButton: {
    maxHeight: "15%",
    minWidth: "30%",
    borderColor: "red",
    borderWidth: 1,
    flex: 1,
    justifyContent: "center"
  },
  signUpText: {
    textAlign: "center",
    fontSize: 20,
  },
});
